import React from 'react';
import '../Popup/Popup.scss'

export default function Popup (props) {
    console.log(props.children);
    return (
        <>
        <ul className='pop_menu_container'>
            {props.children}
            {props.icons}
        </ul>
        </>
        
    )
}
